padding: 10px 22px;
font-size: 18px;
width: 100%;
gap: 10px;
font-weight: bold;
& input {
  padding: 10px 12px;
  border-radius: 12px;
  background: #e6e8e9;
  border: 1px solid #e6e8e9;
  ouline: none;
  }
`;
const TransactionComponent = (props) => {
    return(
    <Container>Transaction
        <input placeholder ="Search"/>
    </Container>
    );
};
